import React from "react";
import styles from "./Player.module.scss";

function Player() {


  return (
    <div className={styles.player}>
      <button className={styles.player__button} aria-label="Previous Track">
        &lt;&lt;
      </button>

      <button className={styles.player__button} aria-label="Play/Pause" onClick={handlePlayMusic}>
        &#9658; 
      </button>

      <button className={styles.player__button} aria-label="Next Track">
        &gt;&gt;
      </button>
    </div>
  );
}

export default Player;
